g2:c.PROCEDURE.g2:a.TEXT:
do-all-test(node: class benchmark-node)
status : truth-value;
status-text: text;
begin
    status, status-text = call do-all-inner();
    if status then call fail(node,status-text)
    else call pass(node);
end

do-all-inner() = (truth-value, text)
status : truth-value;
status-text : text; 
ws : class kb-workspace;
dialog-ws : item-or-value; // if it is item, it is ws
win:class ui-client-item;
visible: truth-value;
i : integer;
v : value; 
itm : class item; 
gnep : class gdl-numeric-entry-point ;
geb : class gdl-encapsulation-block ; 
gdpd : class gdl-data-path-display;

// DEV - I checked only at 1980x1020, but I suppose it should be 0.5 or less in production 
// so that all WS fit onto small resolution screen
scale-for-ws : float = 0.5; 
begin

    // Hide everything and show test-ws
    wait for 12 second; // DEV - set it to lower value in development to save your time
  
    call g2-player-reset (); 
    wait for 0.5 second; 

    win = call rt-util-get-g2-server-window (); 

    // DEV you might want uncomment it for your convenience
    //call rt-util-hide-each-kb-workspace-visible-on-window (win,1);
    show the subworkspace of do-all;
 
    change the text of the g2-user-mode of win to "developer";
    
    // Override for original-gnep
    call rt-util-show-ws-pretty-and-wait(test-ws,win,scale-for-ws,0.5); 
    status, status-text = call override-value-for-numeric-entry-point(original-gnep, "0.0", "7"); 
    if status then return status,status-text;

    // Override value on the subworkspace
    call rt-util-show-ws-pretty-and-wait(sub-ws,win,scale-for-ws,0.5);  
    status, status-text = call override-value-for-numeric-entry-point(original-gnep-upon-sub-ws,"0.0","8");
    if status then return status,status-text; 

    change the text of the g2-user-mode of win to "administrator" ;

    // Clone everything on test-ws
    call rt-util-show-ws-pretty-and-wait(test-ws,win,scale-for-ws,0.5);
    call rt-util-select-all-on-workspace-and-wait (test-ws,1); 
    
    status, status-text = call do-iconic-item-menu-selections (original-gnep , sequence("clone"));
    if status then begin
        post "Error in player test trying cloning items on test-ws";
        return status,status-text;
    end;
    
    status, status-text = call click-on-ws(test-ws, 1, 1);
    if status then begin
        post "Error settling cloned items";
        return status,status-text;
    end;
    
    wait for 0.5 seconds; // wait while items are really settled
    call grtl-deselect-items(win);
    wait for 0.5 seconds; // wait while items are really unselected
    
    // Check that cloned objects do not exist yet
    if (cloned-gnep exists)or(cloned-geb exists)or(cloned-sub-ws exists) then
        return true,"cloned-gnep or cloned-geb exists alredy. You are re-starting test w/o restarting of kb?";
        
    // Give some names to cloned objects 
    for gnep = each gdl-numeric-entry-point upon test-ws do
        if gnep has no name then
            conclude that the names of gnep = the symbol cloned-gnep;
        end;
        
    for geb = each gdl-encapsulation-block upon test-ws do
        if geb has no name then
            conclude that the names of geb = the symbol cloned-geb;
        end;
            
    for gdpd = each gdl-data-path-display upon test-ws do
        if gdpd has no name then
            conclude that the names of gdpd = the symbol cloned-gdpd;
        end;
   
    // Give some names to cloned objects on cloned-sub-ws
    ws = the subworkspace of cloned-geb; 
    conclude that the names of ws = the symbol cloned-sub-ws;
    gnep = the gdl-numeric-entry-point upon cloned-sub-ws;
    conclude that the names of gnep = the symbol cloned-gnep-upon-cloned-sub-ws;

    change the text of the g2-user-mode of win to "developer";
    
    // Override for cloned-gnep
    call rt-util-show-ws-pretty-and-wait(test-ws,win,scale-for-ws,0.5); 
    status, status-text = call override-value-for-numeric-entry-point(cloned-gnep, "0.0", "9"); 
    if status then return status,status-text;

    // Override value on the subworkspace
    call rt-util-show-ws-pretty-and-wait(cloned-sub-ws,win,scale-for-ws,0.5);  
    status, status-text = call override-value-for-numeric-entry-point(cloned-gnep-upon-cloned-sub-ws,"0.0","1"); // was 10 in original
    if status then return status,status-text; 
    
    wait for 1 second; // wait the value to be propagated
    
    v = call gdl-get-data-path-value (cloned-gdpd, the symbol DP-IN);
    if v /= 1 then 
        return true,"Test failure: value [v] on cloned workspace is not as expected";

   return false,"Success";   
end

override-value-for-numeric-entry-point (geep : class item, old-text : text, new-char : text ) = (truth-value, text)
{ old-text is old value which is in the dialog, we need it to find it as text. new-char is a number in range 0..9 represented as text of one char }
status : truth-value;
status-text : text;
i : integer;
dialog-ws : class kb-workspace; 
key-code : integer;
begin

    status, status-text = call do-iconic-item-menu-selections (geep, sequence("override"));
    if status then return status, status-text;
  
    status, status-text = call wait-for-and-click-on-text(old-text,3);
    if status then return status, status-text;

    for i = 1 to 4 do 
        call rt-util-send-key-by-symbol-and-wait (the symbol backspace,0.3);
    end;

    key-code = call g2-translate-character-code-to-event-code(new-char,0);
    call g2-generate-event(the symbol keystroke,key-code,0,0); 

    wait for 0.5;
    call hit-return (); 
    wait for 0.5;
  
    dialog-ws = call rt-util-detect-visible-dialog (the symbol uil-query-dialog);

    if dialog-ws is not a kb-workspace then  
        return true, "Error in player: override dialog not found";
    
    status,status-text = call rt-util-push-the-button-in-uil-dialog ( dialog-ws, "OK");
    if status then return status, status-text;
    
    return false,""
   
end

rt-util-send-key-by-symbol-and-wait( s : symbol, delay-after-sending : float ) 
{Clone of hit-enter from player}
 
code: integer;
begin
    code = call g2-key-code-from-symbol (s);
    call g2-generate-event (the symbol keystroke, code, 0, 0); 
    wait for delay-after-sending;
end

rt-util-select-all-on-workspace-and-wait(ws : class kb-workspace, delay : float) 
win : class g2-window; 
begin
win = call rt-util-get-g2-server-window ();

call g2-ui-select-workspace (ws,win);
wait for 0.2 second;
call rt-util-send-key-by-symbol-and-wait(the symbol control@+a, delay);
end

rt-util-push-the-button-in-uil-dialog(uil-dialog-ws : class kb-workspace, dialog-label : text) = ( truth-value,text)
bu : class uil-button; 
wi : class g2-window; 
begin
wi = call rt-util-get-g2-server-window();
for bu = each uil-button upon uil-dialog-ws do
    if the label of bu = dialog-label then
        begin
        call uil-select-button(bu,wi,uil-dialog-ws);
        return false,"";
        end;
    end;
return true,"Button labeled [dialog-label] not found on target dialog";
end

rt-util-get-g2-server-window () = (class g2-window)
win1,win2 : class g2-window;
begin
win2 = call get-main-g2-window();
for win1 = each g2-window do
    if the g2-window-management-type of win1 exists and the g2-window-management-type of win1 is local and the g2-window-width of win1 /= 22 then 
        begin
            if not (win1 is the same object as win2) then 
                post "get-main-g2-window is a crap";
            return win1;
        end;
    end;
end

rt-util-detect-visible-dialog(dialog-class-name : symbol) = (item-or-value)
// try uil-query-dialog as dialog-class-name first
win:class g2-window;
itm : class kb-workspace;
visible : truth-value;
parent : item-or-value; 
names-expr : text;
begin
    win = call rt-util-get-g2-server-window ();
    for itm = each kb-workspace do
      visible = call g2-item-is-showing-in-window (itm,win);
      if visible and the parent-of-subworkspace of itm exists then
        begin
        parent = the parent-of-subworkspace of itm; 
        // post "[the class of parent]";
        //     the parent-of-subworkspace is class uil-query-dialog then 
        if parent is an instance of the class named by (dialog-class-name) then 
            begin
                // conclude that the names of itm is arlecino;
                return itm;
            end;
        end;
    end;
return the symbol none; 
end

rt-util-hide-each-kb-workspace-visible-on-window-and-wait (win : class g2-window, delay : float)
ws : class kb-workspace;
visible : truth-value; 
begin
  for ws = each kb-workspace do
     visible = call g2-item-is-showing-in-window (ws,win);
     if visible then
       begin
       post "[the class of ws] is visible - hiding it";
       hide ws; 
       end;
  end;
wait for delay; 
end

rt-util-show-ws-pretty-and-wait(ws: class kb-workspace , win: class g2-window, scale : float, delay : float)
begin
show ws at the center of the screen;
show ws scaled by (scale,scale);
call g2-lift-workspace-to-top(ws,win); 
wait for delay;
end
